import ProductComponent from "../components/ProductComponent";

const ProductsContainer = () => {
  


  return (
    <div className="container">
      <NavComponent />
     
      <div clasName="row">

  
            <ProductComponent   />

 
          

      </div>
    </div>
  )
}
export default ProductsContainer;
